import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function Register(props) {
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });

  const cbChange = useCallback((e) => {
    const {name, value} = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  }, [formData])

    return (
        <div className="auth">
            <div className="auth__container">
              <h2 className="auth__title">Регистрация</h2>
              <form className="auth__form" name="auth-form" onSubmit={handleSubmit}>
                <input className="auth__input" name="email" value={value} required type="email" placeholder="Email" onChange={cbChange} />
                <input className="auth__input" name="password" value={value} required type="text" placeholder="Пароль" onChange={cbChange} minLength="5" />
              <button className="auth__submit-button" type="submit" aria-label="Зарегистрироваться">Зарегистрироваться</button>
            </form>
            <Link className="auth__link" to="/signin">Уже зарегистрированы? Войти</Link>
            </div>
        </div>

    )
}

export default Register;
